  const [imageArray, setImageArray] = useState([]);

  useEffect(()=>{
    fetch('https://api.giphy.com/v1/gifs/translate?api_key=GSyXgxVOX5BuSkUGuqSb7T3ICImghVGf&s=cats', 
    {mode: 'cors'})
      .then(res=> res.json())
      .then(info => {
        let tempArray = Object.keys(info.data.images)
        setImageArray(tempArray)
        setImage(info.data.images.original.url)})
  },[])

